import React from 'react';
import { TodoIcon } from './TodoIcon';

function CompleteIcon({ completed }) {
	return (
		<TodoIcon
			type="check"
			color={completed ? '#4caf50' : 'gray'}
		/>
	);
}
export { CompleteIcon };
